webpackJsonp([63458381486184],{2175:function(e,o){e.exports={pathContext:{docHtml:'<h1>colornames</h1>\n<p>Convert color names to HEX color values.</p>\n<p><a href="https://nodei.co/npm/colornames/"><img src="https://nodei.co/npm/colornames.png" alt="NPM"></a></p>\n<p><a href="https://travis-ci.org/timoxley/colornames"><img src="https://travis-ci.org/timoxley/colornames.png?branch=master" alt="Build Status"></a>\n<a href="https://david-dm.org/timoxley/colornames"><img src="https://david-dm.org/timoxley/colornames.png" alt="Dependency Status"></a></p>\n<h2>Installation</h2>\n<h3>Component</h3>\n<pre><code>$ component install timoxley/colornames\n</code></pre>\n<h3>Node/Browserify</h3>\n<pre><code>$ npm install colornames\n</code></pre>\n<h2>Example</h2>\n<pre><code class="language-js">var toHex = require(\'colornames\')\n</code></pre>\n<h3>VGA color names</h3>\n<pre><code class="language-js">toHex(\'red\') // => "#FF0000"\ntoHex(\'blue\') // => "#0000FF"\n</code></pre>\n<h3>CSS color names</h3>\n<pre><code class="language-js">toHex(\'lightsalmon\') // => "#FFA07A"\ntoHex(\'mediumvioletred\') // => "#C71585"\n</code></pre>\n<h3>Get meta data about a color</h3>\n<pre><code class="language-js">toHex.get(\'red\')\n// =>\n{\n  name: "red",\n  css: true,\n  value: "#FF0000",\n  vga: true\n}\n</code></pre>\n<h3>Conversion is case-insensitive</h3>\n<pre><code class="language-js">toHex(\'Blue\') // => "#0000FF"\ntoHex(\'BLUE\') // => "#0000FF"\ntoHex(\'BlUe\') // => "#0000FF"\n</code></pre>\n<h2>API</h2>\n<h3>colornames(name)</h3>\n<p>Get HEX code for a color name, or <code>undefined</code> if unknown.</p>\n<h3>.get(name)</h3>\n<p>All known data about color, including whether valid VGA or CSS color\nname.</p>\n<h3>.get.vga(name)</h3>\n<p>HEX code for a color name, only if the color is a valid VGA color\nname.</p>\n<h3>.get.css(name)</h3>\n<p>HEX code for a color name, only if the color is a valid CSS color\nname.</p>\n<h3>.all()</h3>\n<p>Get all color names data.</p>\n<h2>License</h2>\n<p>  MIT</p>\n<h2>Complete Color Map</h2>\n<p><img src="https://f.cloud.github.com/assets/43438/643981/f57948a0-d381-11e2-99fd-197c44065564.png" alt="example-color-table-"></p>',docPath:"argo-ci/node_modules/colornames/readme",proj:"argo-ci"}}}});
